import React from 'react';
import { useConfig } from './hooks/useConfig';

const TestPage = () => {
  try {
    const { config } = useConfig();
    
    return (
      <div style={{ padding: '20px', backgroundColor: 'lightgreen', minHeight: '100vh' }}>
        <h1>Test Page - useConfig Working</h1>
        <p>If you see this, useConfig hook is working properly.</p>
        <p>Site Title: {config.siteTitle}</p>
        <p>Character Name: {config.character?.name}</p>
      </div>
    );
  } catch (error) {
    return (
      <div style={{ padding: '20px', backgroundColor: 'lightcoral', minHeight: '100vh' }}>
        <h1>Error in useConfig</h1>
        <p>Error: {error.message}</p>
      </div>
    );
  }
};

export default TestPage;
